import React, {Component} from 'react';

class Header extends Component{
	render(props){
		const headerStyle={
			'backgroundImage':this.props.headerImg,
			'backgroundSize':'cover',
			'backgroundPosition':'fixed'
		}
		return(
			<div style={headerStyle}>
				<h3>
					This is the header

				</h3>
			</div>
		)
	}
}

export default Header;
